import React, { Component } from 'react';
import './Header.css'


class Header extends Component {
    render() {
        return (
            <div id ="name">
                <nav class="navbar navbar-expand-lg bg-tranparent fixed-top">
                    <a class="navbar-brand" href="/">Elderly</a>
                    <div class="collapse navbar-collapse" id="navbarNav">
                        <ul class="navbar-nav ">
                            <li class="nav-item ">
                                <a class="nav-link px-md-2" href="#"><h5>หน่วยงานที่เกี่ยวข้อง</h5></a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link px-md-2" href="#"><h5>Feature</h5></a>
                            </li>
                            <li class="nav-item">
                                <a class="nav-link px-md-2" href="#"><h5>Pricing</h5></a>
                            </li>
                            
                        </ul>
                    </div>
                </nav>
            </div>
        );
    }

}
export default Header;
